import React from 'react';
import './Navbar.css';
import {Link} from 'react-router-dom';


function Navbar (){
    return(
        <>
        <nav className="navbar">
            <div className="navbar-container">
                <Link to='/' className='navbar-logo'>
                    <img src='/images/logo.png'/>
                </Link>
            </div>
            
        </nav>
        </>
    )
}

export default Navbar;
